import Foundation
extension String {
    subscript (i: Int) -> Character {
        return self[index(startIndex, offsetBy: i)]
    }
}

func camelcase(s: String) -> Int {
    var index: Int = 0
    var i: Int = 1
    var str = s
    let m: Int = 500
    
    while str.count != 0  {
        var n = 0
        if m < str.count {
            while n != m {
                if String(str[n]) == str[n].uppercased() {
                    i += 1
                }
                    n += 1
                }
            str.removeFirst(m)
        } else {
            if String(str.first!) == str.first!.uppercased() {
                i += 1
            }
            str.removeFirst()
        }
    
        index += 1
    }
  
    return i
}

